import { defineMessages } from 'react-intl';

export const scope = 'app.containers.DistributorInfo';

export default defineMessages({
  distributor: {
    id: `${scope}.distributor`,
    defaultMessage: 'Distributor',
  },
  businessProfile: {
    id: `${scope}.businessProfile`,
    defaultMessage: 'Business Profile',
  },
  individualProfile: {
    id: `${scope}.individualProfile`,
    defaultMessage: 'Individual Profile',
  },
  locationDetails: {
    id: `${scope}.locationDetails`,
    defaultMessage: 'Location Details',
  },
  bankingDetails: {
    id: `${scope}.bankingDetails`,
    defaultMessage: 'Banking Details',
  },
});
